Counter-Strike 2 is a tactical first-person shooter that, according to some players, retained the best qualities of previous versions and added new features. 

Some pros of the game:
- improved graphics, soundtrack and skin appearance;
- redesigned maps;
- a new Premier mode and an innovative system of registering moves and hits sub-tick;
- gifts every week;
- lots of different chips.

Some cons:
- the game is computer demanding, not everyone has powerful enough PCs;
- a number of users could not run the game because of errors;
- VAC Live can't cope with the influx of cheaters;
- the game is quite raw.

Opinions about the game can be different, and it is impossible to objectively evaluate Counter-Strike 2, because even before the release players were divided into camps with different attitudes to the shooter.

